import React, { useState } from "react";
import { render } from "react-dom";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";

const CompoundInterest = () => {

  const [anualSimples, setAnualSimples] = useSate()
  const [mesSimples, setMesSimples] = useSate()
  const [anualComposto, setAnualComposto] = useSate()
  const [mesComposto, setmesComposto] = useSate()

  return (
  <>
    <form>
    <TextField label="Juros Anual Simples" 
    variant="outlined"
    onChange={(e) => setAnualSimples(e.target.value)}
    />
    <TextField label="Juros ao Mês Simples" variant="filled" />
    </form>
  </>
  );
};

const CompoundInterest2 = () => {
  return (
  <>
    <form>
    <TextField label="Juros Anual Composto" variant="outlined" />
    <TextField label="Juros ao Mês Composto" variant="filled" />
    </form>
  </>
  );
};

render(<CompoundInterest />, document.querySelector("#root"));

